import './header.css';

export function Header()
:  JSX.Element
{
	return (
		<header>
			<div id="logo">
				<div id="P">P</div>
				<div id="O">O</div>
				<div id="N">N</div>
				<div id="G">G</div>
			</div>
		</header>
	);
}
